const contractAddress = '0xE00df4b1e5724Be2B57b11CDa2B4643ca02C3ACE';

function App() {
  const [web3, setWeb3] = useState(null);
  const [account, setAccount] = useState(null);
  const [contract, setContract] = useState(null);
  const [userAddress, setUserAddress] = useState('');
  const [referrerAddress, setReferrerAddress] = useState('');
  const [userBalance, setUserBalance] = useState('0');
  const [isRegistered, setIsRegistered] = useState(false);
  const [matrix, setMatrix] = useState(1);
  const [level, setLevel] = useState(1);
  const [userDetails, setUserDetails] = useState(null);

  useEffect(() => {
    const initWeb3 = async () => {
      if (window.ethereum) {
        try {
          const web3Instance = new Web3(window.ethereum);
          setWeb3(web3Instance);

          const accounts = await window.ethereum.request({ method: 'eth_requestAccounts' });
          setAccount(accounts[0]);

          const contractInstance = new web3Instance.eth.Contract(contractABI, contractAddress);
          setContract(contractInstance);

          console.log('Web3, account, and contract successfully loaded.');
        } catch (error) {
          console.error('Error loading Web3, account, or contract:', error);
        }
      } else {
        alert('Please install MetaMask!');
      }
    };

    initWeb3();
  }, []);

  useEffect(() => {
    if (web3 && contract && account) {
      const loadUserDetails = async () => {
        try {
          const balance = await web3.eth.getBalance(account);
          setUserBalance(web3.utils.fromWei(balance, 'ether'));
  
          const registered = await contract.methods.isUserExists(account).call();
          setIsRegistered(registered);
  
          if (registered) {
            const user = await contract.methods.users(account).call();
            setUserDetails(user);
          }
  
          // Example to log methods in the contract
          console.log('Contract Methods:', contract.methods);
        } catch (error) {
          console.error('Error loading user details:', error);
        }
      };
  
      loadUserDetails();
    }
  }, [web3, contract, account]);

  const register = async () => {
    if (!web3 || !contract || !account) {
      alert('Web3, contract, or account not loaded');
      console.error('Web3:', web3);
      console.error('Contract:', contract);
      console.error('Account:', account);
      return;
    }

    try {
      await contract.methods.registrationExt(referrerAddress).send({
        from: account,
        value: web3.utils.toWei('0.05', 'ether')
      });
      alert('Registration successful');
    } catch (error) {
      console.error('Error during registration:', error);
      alert('Registration failed');
    }
  };
  
  const buyNewLevel = async () => {
    if (!web3 || !contract || !account) {
      alert('Web3, contract, or account not loaded');
      return;
    }
  
    try {
      // Verify that the method exists
      if (typeof contract.methods.levelPrice !== 'function') {
        throw new Error('Method levelPrice is not available on the contract.');
      }
  
      console.log('Attempting to buy new level:', { matrix, level });
  
      const matrixInt = parseInt(matrix, 10);
      const levelInt = parseInt(level, 10);
  
      if (matrixInt < 1 || matrixInt > 2) {
        throw new Error('Matrix value is out of range. It should be 1 or 2.');
      }
      if (levelInt < 1 || levelInt > 12) {
        throw new Error('Level value is out of range. It should be between 1 and 12.');
      }
  
 if (typeof contract.methods.levelPrice === 'function') {
  const levelPriceWei = await contract.methods.levelPrice(levelInt).call();
  console.log('Level price returned by contract (Wei):', levelPriceWei);
} else {
  console.error('Method levelPrice is not available on the contract.');
}

      await contract.methods.buyNewLevel(matrixInt, levelInt).send({
        from: account,
        value: levelPriceWei,
        gas: 3000000, 
        gasPrice: web3.utils.toWei('50', 'gwei') 
      });
  
      alert('Level purchase successful');
    } catch (error) {
      console.error('Error during level purchase:', error);
      alert('Level purchase failed: ' + error.message);
    }
  };
  
  
  
  return (
    <div className="flex flex-col items-center justify-center min-h-screen bg-gray-800 text-white">
      <h1 className="text-3xl font-bold mb-8">SmartMatrixForsage Registration</h1>
      <div className="mb-4">
        <label className="block text-lg mb-2">
          User Address:
          <input
            className="mt-1 block w-full px-3 py-2 bg-gray-900 border border-gray-700 rounded-md text-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500"
            type="text"
            value={userAddress}
            onChange={e => setUserAddress(e.target.value)}
            placeholder="Enter your address"
          />
        </label>
      </div>
      <div className="mb-4">
        <label className="block text-lg mb-2">
          Referrer Address:
          <input
            className="mt-1 block w-full px-3 py-2 bg-gray-900 border border-gray-700 rounded-md text-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500"
            type="text"
            value={referrerAddress}
            onChange={e => setReferrerAddress(e.target.value)}
            placeholder="Enter referrer address"
          />
        </label>
      </div>
      <button
        onClick={register}
        className="px-6 py-2 bg-blue-600 rounded-md hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-blue-500 mb-4"
      >
        Register
      </button>

      <div className="mb-4">
        <h2 className="text-2xl font-bold mb-4">User Info</h2>
        <p>Account: {account}</p>
        <p>Balance: {userBalance.slice(0,5)} ETH</p>
        <p>Registered: {isRegistered ? 'Yes' : 'No'}</p>
        {userDetails && (
          <div>
            <p>User ID: {userDetails.id}</p>
            <p>Referrer: {userDetails.referrer}</p>
            <p>Partners Count: {userDetails.partnersCount}</p>
          </div>
        )}
      </div>

      <div className="mb-4">
        <label className="block text-lg mb-2">
          Matrix:
          <input
            className="mt-1 block w-full px-3 py-2 bg-gray-900 border border-gray-700 rounded-md text-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500"
            type="number"
            value={matrix}
            max={2}
            min={1}
            onChange={e => setMatrix(e.target.value)}
            placeholder="Enter matrix1 or matrix2"
          />
        </label>
      </div>
      <div className="mb-4">
        <label className="block text-lg mb-2">
          Level:
          <input
            className="mt-1 block w-full px-3 py-2 bg-gray-900 border border-gray-700 rounded-md text-gray-300 focus:outline-none focus:ring-2 focus:ring-blue-500"
            type="number"
            value={level}
            onChange={e => setLevel(e.target.value)}
            placeholder="Enter level between 1 and 12"
            max={12}
            min={1}
          />
        </label>
      </div>
      <button
        onClick={buyNewLevel}
        className="px-6 py-2 bg-green-600 rounded-md hover:bg-green-700 focus:outline-none focus:ring-2 focus:ring-green-500"
      >
        Buy New Levels
      </button>
    </div>
  );
}

export default App;
